function Song(t){this.title=t.title,this.author=t.author,this.duration=t.duration}function Player(){this.guess="",this.score=0}function Game(t,n){this.roundCount=0,this.players=t,this.songs=n,this.round={}}function Round(t,n){this.player=t,this.song=n}function nextRound(t){}function setPlayer(t){}Game.prototype.buildRound=function(){var t=new Round(this.currentPlayer(),this.currentSong());this.roundCount++,this.round=t},Game.prototype.currentPlayer=function(){return this.players[this.round%this.players.length]},Game.prototype.nextPlayer=function(){return this.players[(this.round+1)%this.players.length]},Game.prototype.currentSong=function(){return this.songs[this.round%this.songs.length]},Game.prototype.nextSong=function(){return this.songs[(this.round+1)%this.songs.length]},Game.prototype.checkGuess=function(){return this.round.song.title===$("#song-guess").val()},$(document).ready(function(){var t=new Player,n=new Song({title:"tell me what you want",author:"spice girls",duration:100}),o=new Game([t],[n]);o.buildRound(),console.log(o),$(document).on("click",o.checkGuess)});